import { Injectable } from '@angular/core';
import { IPaginationPlugin, IPlugin, IPluginStore } from '@ngx-page-builder';

@Injectable()
export class PluginService implements IPluginStore {
  private _plugins: IPlugin[] = [
    {
      image:
        'data:image/png;base64,',
      name: 'card with long name for testcard with long name for test',
      plugin:
        '{"sanitized":{"id":"mkv345f0-RUFrg","dataSource":{},"children":[{"id":"mkw56bla-CKjxz","dataSource":{"binding":""},"children":[],"tag":"img","canHaveChild":false,"options":{"attributes":{"loading":"lazy","class":"","src":"data:image/jpeg;base64,"}},"classList":["img-mkw56bla-CKjxz"]},{"id":"mkw56fcv-Rffaf","dataSource":{"binding":"name"},"children":[],"tag":"h3","canHaveChild":false,"content":"Sample Product","options":{"attributes":{"class":""}},"classList":["h3-mkw56fcv-Rffaf"]},{"id":"mkw56l2k-GwCbN","dataSource":{"binding":"description"},"children":[],"tag":"p","canHaveChild":false,"content":"Sample product description","options":{"attributes":{"class":""}},"classList":["p-mkw56l2k-GwCbN"]},{"id":"mkw570au-ijyvu","dataSource":{"binding":"price"},"children":[],"tag":"h6","canHaveChild":false,"content":"100","options":{"attributes":{"class":""}},"classList":["h6-mkw570au-ijyvu"]},{"id":"mkwcx9oc-OWyfc","dataSource":{},"children":[],"tag":"h4","canHaveChild":false,"content":"<p><span style=\\"font-family: iranSans;\\"> </span></p>","options":{"attributes":{"class":""}},"classList":["h4-mkwcx9oc-OWyfc"]}],"tag":"article","canHaveChild":true,"options":{"attributes":{"class":""}},"classList":["card-collection"]}}',
    },
  ];

  constructor() {
    const plugins = JSON.parse(localStorage.getItem('plugins') || '[]') || [];
    if (plugins.length > 0) this._plugins = plugins;
  }

  getAllPlugins(take: number, skip: number, filter: string): Promise<IPaginationPlugin> {
    return new Promise<IPaginationPlugin>((resolve, reject) => {
      const result = this._plugins.filter((x) => x.name.includes(filter));
      const list = result.slice(skip, skip + take);
      resolve({
        items: list,
        total: result.length,
      });
    });
  }
  save(plugin: IPlugin): void {
    console.log('i get plugin', plugin);
    this._plugins.push(plugin);
    localStorage.setItem('plugins', JSON.stringify(this._plugins));
  }
}
